const startposition = [[750, 573], [1053, 593], [1019, 502], [1077, 681], [1038, 571], [1022, 541], [1125, 520], [1083, 558], [1092, 569], [1062, 520], [1010, 540],[1061, 582], [1086, 596], [947, 818]];

//global variable
var errocount = 0; //count error
var cursorx = 0; // red dot xposition
var cursory = 0; // red dot yposition
