// get position
function getPosition(obj) {
    var curleft = 0, curtop = 0;
    if (obj.offsetParent) {
        do {
            curleft += obj.offsetLeft;
            curtop += obj.offsetTop;
        } while (obj = obj.offsetParent);
        return { x: curleft, y: curtop };
    }
    return undefined;
}
function qkeydown(event) {
    var x = event.key;
    if (x == 'q') {
        nextimage();
    }
}
function rgbToHex(r, g, b) {
    if (r > 255 || g > 255 || b > 255)
        throw "Invalid color component";
    return ((r << 16) | (g << 8) | b).toString(16);
}

function reddotclick() {
    if ((cursorx >= 900) && (cursorx <= 990) && (cursory >= 1000) && (cursory <= 1040)) {
        nextimage();
    }
}

function drawImageFromWebUrl(sourceurl){
      var img = new Image();

      img.addEventListener("load", function () {
          // The image can be drawn from any source
        //   canvas.width = this.naturalWidth;
        // canvas.height = this.naturalHeight;
        canvas.width = window.innerWidth;
        canvas.height = window.innerHeight;
        canvas.getContext("2d").drawImage(this, 700, 300);
          
      });

      img.setAttribute("src", sourceurl);
}


function starttrace() {
    drawImageFromWebUrl(imageurl[imagecount]);
    // $("#start").css("display","none");
    document.getElementById('start').style.display = "none";

    // $("#quit").css("display", "block");
    // $('#canvas').css('visibility', 'visible');
    // $('#canvas').css('cursor', 'none');
    // $('#cursor').css("display", "block");
    document.getElementById('quit').style.display = "block";      
    document.getElementById('canvas').style.visibility = "visible";
    document.getElementById('canvas').style.cursor = "none";
    cursorx = startposition[imagecount][0];
    cursory = startposition[imagecount][1];
    Cursorpostiondata[imagecount].push([cursorx, cursory]);
    starttime = new Date().getTime();
    const cursor = document.getElementById('cursor');
    cursor.style.top = cursory + 'px';
    cursor.style.left = cursorx +'px';
    document.getElementById('cursor').style.display = "block";
    canvas.addEventListener("mouseenter", function(e){
        mousecursorx = e.pageX;
        mousecursory = e.pageY;
    }, false);
    mousemoveerror();
    
} 

function download(filename, text) {
    var element = document.createElement('a');
    element.setAttribute('href', 'data:text/plain;charset=utf-8,' + encodeURIComponent(text));
    element.setAttribute('download', filename);
  
    element.style.display = 'none';
    document.body.appendChild(element);
  
    element.click();
  
    document.body.removeChild(element);
  }
  
function nextimage() {
    imagecount++;
    Totaltime = (new Date().getTime() - starttime)/1000;
    Timedata.push(Totaltime);
    Errorcountdata.push(errocount);
    if (imagecount < 14) {
        starttime = new Date().getTime();
        errocount = 0;
        document.getElementById('errorcount').innerHTML = errocount;
        drawImageFromWebUrl(imageurl[imagecount]);
    const cursor = document.getElementById('cursor');
    cursorx = startposition[imagecount][0];
    cursory = startposition[imagecount][1];
    cursor.style.top = cursory + 'px';
    cursor.style.left = cursorx +'px';

    mousemoveerror();
    } else {
        var resultdata = new Object();
        resultdata.errorcount = Errorcountdata;
        resultdata.timecount = Timedata;
        resultdata.cursorposition = Cursorpostiondata;
         
        console.log("result", resultdata);
        resultdata = JSON.stringify(resultdata);
        download("resultdata", resultdata);

        alert("Press F5 to restart");


    }
    
}
// Draw a base64 image because this is a fiddle, and if we try with an image from URL we'll get tainted canvas error
// Read more about here : http://ourcodeworld.com/articles/read/182/the-canvas-has-been-tainted-by-cross-origin-data-and-tainted-canvases-may-not-be-exported


canvas.addEventListener("mousemove",function(e){
	var pos = getPosition(this);
    var x = cursorx - pos.x + 3;
    var y = cursory - pos.y + 3;
    deltax = e.pageX - mousecursorx;
    deltay = e.pageY - mousecursory;
    mousecursory = e.pageY;
    mousecursorx = e.pageX;
    cursorx -= deltax;
    cursory -= deltay;
    const cursor = document.getElementById('cursor');
    cursor.style.top = cursory + 'px';
    cursor.style.left = cursorx +'px';
    Cursorpostiondata[imagecount].push([cursorx, cursory]);    
    var coord = "x=" + x + ", y=" + y;
    var c = this.getContext('2d');
    var p = c.getImageData(x, y, 1, 1).data; 
    // If transparency on the image
    if((p[0] == 0) && (p[1] == 0) && (p[2] == 0) && (p[3] == 0)){
 				coord += " (Transparent color detected, cannot be converted to HEX)";
    }    
    var hex = "#" + ("000000" + rgbToHex(p[0], p[1], p[2])).slice(-6);    
    document.getElementById("status").innerHTML = coord;
    document.getElementById("color").style.backgroundColor = hex;
    if ((p[0] == 255) && (p[1] == 255) && (p[2] == 255) && (p[3] == 255)) {
        errocount++;
        // setTimeout(play(), 1000)
        document.getElementById("errormessage").innerHTML = "Outline Error!";
        document.getElementById("errormessage").style.display = "block";
        setTimeout(function() {
            document.getElementById("errormessage").style.display = "none"; 
        }, 2000);
    }
    time = new Date().getTime();
    document.getElementById('errorcount').innerHTML = errocount;    
},false);

function mousemoveerror() {
    setInterval(function(){
        var nowtime = new Date().getTime();
        if ((nowtime-time) >= 3000) {            
            errocount++;
            document.getElementById('errorcount').innerHTML = errocount;
            document.getElementById("errormessage").innerHTML = "Timeout Error!";
            document.getElementById("errormessage").style.display = "block";
        setTimeout(function() {
            document.getElementById("errormessage").style.display = "none"; 
        }, 2000);
        }
    }, 3000);
}
  
